import styled from "@emotion/styled";

import "./App.css";
import { Keyboard } from "./keyboard";

export default function App() {
  return (
    <Container>
      <SvgBox>
        <Keyboard />
      </SvgBox>
      <Title>키보드</Title>
      <SubTitle>들어보고 구매하는 키보드 스토어</SubTitle>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  align-items: center;
`;

const SvgBox = styled.div`
  margin: auto;
  width: 200px;
`;

const Title = styled.div`
  font-weight: bold;
  font-size: 20px;
  text-align: center;
`;

const SubTitle = styled.div`
  margin-top: 12px;
  font-weight: bold;
  font-size: 12px;
  text-align: center;
`;
